<div class="entities" style="line-height: 2.5; direction: ltr">Red meat and poultry , cooking practices , genetic susceptibility and risk of prostate cancer : results from a multiethnic case-control study . Red meat , processed and unprocessed , has been considered a potential prostate cancer ( DB11245 ) risk factor ; epidemiological evidence , however , is inconclusive . An association between meat intake and DB11245 may be due to potent chemical carcinogens that are generated when meats are cooked at high temperatures . We investigated the association between red meat and poultry intake and localized and advanced DB11245 taking into account cooking practices and polymorphisms in enzymes that metabolize carcinogens that accumulate in cooked meats . We analyzed data for 1096 controls , 717 localized and 1140 advanced cases from the California Collaborative Prostate Cancer Study , a multiethnic , population-based case-control study . We examined nutrient density-adjusted intake of red meat and poultry and tested for effect modification by 12 SNPs and 2 copy number variants in 10 carcinogen metabolism genes :

<h2 style="margin: 0">3</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Blocking dopamine D2 receptors by haloperidol curtails the beneficial impact of calorie restriction on the metabolic phenotype of high-fat diet induced obese mice . Calorie restriction is the most effective way of expanding life-span and decreasing morbidity . It improves insulin sensitivity and delays the age-related loss of dopamine receptor D ( 2 ) ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416

</mark>
 ) expression in the brain . Conversely , high-fat feeding is associated with obesity , insulin resistance and a reduced number of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 binding sites . We hypothesised that the metabolic benefit of calorie restriction involves the preservation of appropriate 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 transmission . The food intake of wild-type C57Bl6 male mice was restricted to 60 % of ad lib . intake while they were treated with the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist haloperidol or vehicle using s . c . implanted pellets . Mice with ad lib . access to food receiving vehicle treatment served as controls . All mice received high-fat food throughout the experiment . After 10 weeks , an i . p . glucose tolerance test was performed and , after 12 weeks , a hyperinsulinaemic euglycaemic clamp . Hypothalamic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 binding was also determined after 12 weeks of treatment . Calorie-restricted ( CR ) vehicle mice were glucose tolerant and insulin sensitive compared to ad lib . ( AL ) fed vehicle mice . CR mice treated with haloperidol were slightly heavier than vehicle treated CR mice . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00502
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 completely abolished the beneficial impact of calorie restriction on glucose tolerance and partly reduced the insulin sensitivity observed in CR vehicle mice . The metabolic differences between AL and CR vehicle mice were not accompanied by alterations in hypothalamic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 plasminogen activator augments cell proliferation and neointima formation in injured arteries via proteolytic mechanisms . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00013

</mark>
 plasminogen activator ( uPA ) has been implicated in the healing responses of injured arteries , but the importance of its various properties that influence smooth muscle cell ( SMC ) proliferation and migration in vivo is unclear . We used three recombinant ( r - ) forms of uPA , which differ markedly in their proteolytic activities and abilities to bind to the uPA receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q03405

</mark>
 ) , to determine , which property most influences the healing responses of balloon catheter injured rat carotid arteries . After injury , uPA and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q03405
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression increased markedly throughout the period when medial SMCs were rapidly proliferating and migrating to form the neointima . Perivascular application of uPA neutralizing antibodies immediately after injury attenuated the healing response , significantly reducing neointima size and neointimal SMC numbers . Perivascular application of r-uPAwt ( wild type uPA ) or r-uPA / GDF ( r-uPA with multiple mutations in its growth factor-like domain ) doubled the size of the neointima . Four days after injury these two uPAs nearly doubled neointimal and medial SMC numbers in the vessels , and induced greater reductions in lumen size than injury alone . Proteolytically inactive r-uPA / H / Q ( containing glutamine rather than histidine - 204 in its catalytic site ) did not affect neointima or lumen size . Also , in contrast to the actions of proteolytically active uPAs , tissue plasminogen activator ( tPA ) did not affect the rate of neointima development . We conclude that uPA is an important factor regulating the healing responses of balloon catheter injured arteries , and its proteolytic property , which can not be mimicked by tPA , greatly influences SMC proliferation and early neointima formation .</div>

 at a site that is different from the orthosteric site , thus making

<div class="entities" style="line-height: 2.5; direction: ltr">A human seminoma xenograft model with regional lymph node metastasis . PURPOSE : To establish a seminoma orthotopic model with lymph node metastasis to investigate the factors related to the lymphophilic behavior of seminoma cells . MATERIALS AND METHODS : Testicular seminoma xenografts were established by the inoculation of small fragments from subcutaneous ( s . c . ) xenografts that had previously been established in severe combined immunodeficient ( SCID ) mice with a supraclavicular lymph node metastasis from a human seminoma . Hematologic dissemination of tumor cells was analyzed by polymerase chain reaction ( PCR ) amplification of the human beta-globin gene . Xenograft messenger RNA levels of metastasis-related genes were examined by reverse transcription ( RT ) - PCR . RESULTS : Testicular seminoma xenografts grew in 32/32 ( 100 % ) of the inoculated mice , of which 15 mice ( 47 % ) developed macroscopic metastasis to the renal hilar lymph node . Circulating tumor cells and tumor cell shedding in the lung and liver were detectable by PCR assay in 25/32 ( 78 % ) , 32/32 ( 100 % ) , and 27/32 ( 84 % ) mice , respectively , although metastatic foci were not histologically evident in these organs . Increased expression of matrix metalloproteinase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , membrane-type 3 matrix metalloproteinase (

 ) and vascular endothelial growth factor (

    P15692

 ) , and reduction in expression of plasminogen activator inhibitor - 2 (

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 . These data indicate that uPA contributes to endogenous fibrinolysis in the pulmonary vasculature to the same extent as tPA in this model system . Binding of scuPA to its receptor promotes fibrinolytic activity in vivo as well as in vitro . The physical properties of fibrin clots , including size , age , and cellular composition , as well as heterogeneity in endothelial cell function , may modify the participation of uPA in endogenous fibrinolysis . ( Blood . 2000 ; 96:1820- 1826 )</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Helicobacter pylori-induced interleukin - 12 p40 expression . Interleukin - 12 ( IL - 12 ) is a heterodimeric cytokine produced by antigen-presenting cells that promotes the development of T-helper lymphocyte 1 ( Th1 ) . Chronic gastritis induced by Helicobacter pylori is considered a Th1 - mediated process . IL - 12 levels in gastric biopsy samples of H . pylori-infected patients are higher than in those of uninfected individuals , but the cellular source of IL - 12 remains elusive . IL - 12 staining was detected in mucosal epithelial cells , lymphocytes , and macrophages in specimens of patients with H . pylori-positive gastritis . Therefore , we investigated IL - 12 p40 mRNA induction by H . pylori in gastric epithelial cells and T cells . Although cag pathogenicity island (

 .</div>

 was released in higher amounts from endometrial tissue explants obtained in the midcycle phase than from those obtained in the luteal phase .

 activator activity of the culture medium followed the same pattern . Treatment of postmenopausal patients with ethinylestradiol resulted in liberation of urokinase and tissue activator from endometrial explants in concentrations similar to those found in the normal midcycle phase . In contrast , treatment with oral contraceptives ( OCs ) , containing ethinylestradiol and a progestagen , resulted in lowered release of both activators , even lower than was found during the normal luteal phase . Also the amounts of extractable urokinase from endometrial tissue samples were significantly lower in OC-users than in non-users . Estradiol seems to have a stimulatory effect on the release of plasminogen activators from the endometrium ; whereas , gestagens depress the content and release of activators . The low content of plasminogen activators in the endometrium explains the reduced menstrual bleedings found in OC-users .</div>

 therapy of deep vein thrombosis ( author ' s transl ) ] . 30 patients with deep vein thrombosis were treated with a combination of urokinase and heparin . Clinically relevant improvement was achieved in 2/3 of them with appr . 40,000 IU / h ( 1,000 , 000 IU / d ) urokinase administered over a period of several days . This indicates that urokinase at this dosage offers a valuable alternative or supplementation to fibrinolytic therapy with streptokinase . With the dosage employed , routine blood coagulation tests are only minimally affected , although a strong enhancement of fibrinolytic activity can be demonstrated by the euglobulin clot lysis time .

<h2 style="margin: 0">38</h2>

 activation by airway smooth muscle is regulated by type I collagen . Plasmin , the activated protease product of plasminogen , is involved in collagen remodeling , and is strongly implicated in asthma pathophysiology by recent genome-wide association studies . This study examines plasminogen &quot; activation &quot; by airway smooth muscle cells , and its regulation in a fibrotic environment created by culture on type I collagen and incubation with transforming growth factor ( TGF ) - β . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 plasminogen activator ( uPA ) activity was detected in the supernatants of human airway smooth muscle cell cultures maintained in serum-free conditions . Incubation with plasminogen ( 1.5- 50.0 μg / ml , 24 h ) increased plasmin activity in a concentration-dependent manner ( P &lt; 0.001 ) . uPA activity was higher in cultures maintained on fibrillar type I collagen substrata than in those on plastic , as was plasmin activity after incubation with plasminogen ( 20 μg / ml ) . Pretreatment with TGF-β ( 100 pM ) for 18 hours inhibited plasminogen activation by airway smooth muscle cells maintained on plastic , but not on collagen . TGF-β stimulated an increase in the level of uPA mRNA in airway smooth muscle cells grown on collagen , but not on plastic . Reducing the levels of β1 - integrin collagen receptor , using interference RNA , attenuated plasmin formation by airway smooth muscle cells grown on collagen , and restored the inhibitory effect of TGF-β . This study shows that airway smooth muscle activation of plasminogen by uPA is accelerated in a collagen-rich environment in which the inhibitory effect of TGF-β is attenuated in association with greater uPA expression induced via β1 - integrin signaling . These findings suggest that the plasminogen-activation system involving uPA has the potential to contribute to airway wall remodeling in asthma .</div>

 activators , venous leg ulcers and reepithelialization . BACKGROUND AND OBJECTIVE : The pathogenesis of leg ulcers due to chronic venous hypertension ( CVH ) seems to be related to perivenular fibrin-film formation due to decreased cutaneous fibrinolytic activity dependent on reduced release of tissue-type plasminogen activator that leads to tissue anoxia and ulcer formation . The purpose of the work is a spectrophotometric evaluation of urokinase ( Q96NZ9 ) at the edge , the floor and in the periulcerous skin of leg ulcers . METHODS : We examined a group of 10 patients with chronic leg ulcers caused by CVH . The biopsies from each patient were taken : ( 1 ) from the edge of the ulcer ; ( 2 ) from the perilesional skin and ( 3 ) from the floor of the ulcer .

 levels were evaluated in the same areas in 10 control subjects . The Q96NZ9 activity was determined spectrophotometrically at 405 nm . RESULTS : The results of our study showed that Q96NZ9 is detectable in the center of the ulcer , on the edge , in the perilesional skin , as well as in the controls . Data are statistically significant . The highest levels of Q96NZ9 are found at the edge of the ulcer ; they were lower in the center and in the periulcerous skin . CONCLUSION : A chemoattracting effect of Q96NZ9 on human keratinocytes has been documented and this study showed significantly higher levels of Q96NZ9 at the edge and on the floor of the ulcers , suggesting a possible role of an Q96NZ9 gradient that could promote mobilization of keratinocytes from the edge to the floor , thus inducing reepithelialization . Moreover , Q96NZ9 could play some role in neoangiogenesis and fibroblast chemoattraction , thus contributing in various ways to wound healing .</div>
